import Login from "./component/login";
import Home from "./component/home";
function log(){
document.getElementById("in").innerHTML=`
<BrowserRouter>
<Routes>
  <Route path='/' element=${<Login/>}/>
  <Route path='home' element=${<Home/>}/>
</Routes>
</BrowserRouter>
`
}



export default log
